import React,{Component} from 'react'
import './Calculator.css'
import Button from '../components/Button'

export default class Calculator extends Component{

    render(){
        return (
            <div className='calculator'>
                <Button label='AC'/>
                <Button label='/'/>
                <Button label='7'/>
                <Button label='8'/>
                <Button label='9'/>
                <Button label='*'/>
                <Button label='4'/>
                <Button label='6'/>
                <Button label='_'/>
            </div>
        )
    }
}
